Clean MongoDB/Node.js/Express code and routes<p>I started learning database with MongoDB and Node.js not long ago and I'm trying to find a way to use Express routes <strong>without</strong> mongoose. I want to insert data using Express routes and have clean code exporting different modules. The problem is that i can't write routes
as below because in my index.js file "db" is of course not defined and apparently i can't insert data into my "db" outside of the function "client.connect" as with mongoose. Do i have to connect my db in a file with all my posts or is there a specific way to do it? (sorry for my English, I'm learning it).</p>

<p>App.js :</p>

<pre><code>const express = require('express');
const app = express();
const expressLayouts = require('express-ejs-layouts');
const MongoClient = require('mongodb').MongoClient;
const assert = require('assert');

//EJS
app.use(expressLayouts);
app.set('view engine', 'ejs');

//Styles
app.use('/public', express.static('public'));

//Bodyparser
app.use(express.urlencoded({extended: false}));


//Connect to DB
const url = 'mongodb://localhost:27017/shopping'
const dbName = 'shopping';
const client = new MongoClient(url);

client.connect((err)=&gt;{
    assert.equal(null, err);
    console.log('connected to db...');

    app.use('/', require('./routes/index'));    

    const db = client.db(dbName);
});

//Server
app.listen(3000, ()=&gt;{console.log("Listening to port 3000")});
</code></pre>

<p>index.js (routes):</p>

<pre><code>const express = require('express');
const router = express.Router();

//Get home page
router.get('/', (req, res)=&gt;{
    res.render('shop/index')
});

router.get('/posts', (req,res)=&gt;{
    res.render('posts')
});

router.post('/posts',(req,res)=&gt;{
    db.collection('users').insertOne({'name': req.name, 'password': req.password});
});

module.exports = router;
</code></pre>

