how to dynamically update the nested objects in mongodb<p>We have some arbitrarily nested configuration that we store in the mongodb. </p>

<ol>
<li>Let say we initially store the following object in the mongodb. </li>
</ol>

<pre><code>
const value = { 'a': { 'b': 1 } }

collection.insertOne({userId, value})

</code></pre>

<p>now I want to modify the object in the database by adding </p>

<pre><code>const addValue = { 'f': { 'c': 2 } }
</code></pre>

<p>and similarly with few more nested object.</p>

<pre><code>const addValue1 = { 'a': { 'd': 1 }, 'f': { 'g': 1 } };
</code></pre>

<p>As we adding, these <code>keys</code> are very dynacmic and should able to update value in the db but not replace it, so expecting the end result stored should be</p>

<pre><code>const result = collection.findOne({ userId });

console.log(result);

{ 'a': { 'b': 1, 'd': 1 }, 'f': { 'g': 1, 'c': 2 } }

</code></pre>

<p>And also overwrite if the udpate value is</p>

<pre><code>const addValue2 = { 'a': { 'b' : { 'e': 1 } } }
</code></pre>

<p>expected result is</p>

<pre><code>const result2 = { 'a': { 'b': { 'e': 1 } , 'd': 1 }, 'f': { 'g': 1, 'c': 2 } }

</code></pre>

<h2>Similarly when deleting</h2>

<pre><code>    let testObject = new MongoDBStorageService('test', dbConnection as any, 'userTestSchema');

    testObject.load({ 'a': { 'b': 1 }});
    testObject.removeValue('a.b');

    const content = await testObject.contents;

 expect(content).toEqual({}); // but we see output as `{ a: {} }`
</code></pre>

<p>Remove method used</p>

<pre><code>public async removeValue(key: string) {
        return await this.remove(JSON.parse(`{\"${key}\": "" }`));
    }
private remove(value) {
    return new Promise((resolve, reject) =&gt; {
        this.collection.updateOne({ user: this.userId }, {
            $unset: value,
        }, { upsert: false }, function (err, res) {
            if (err) {
                reject(err);
            } else {
                console.log('REUSLL AFTER REMOVE', res.);
                resolve({ id: true });
            }
        });
    });
}
</code></pre>

