Mongoose restrict returned data to model<p>I have the most basic Mongoose schema possible. Something like this : </p>

<pre><code>var mongoose = require("mongoose");
var Schema = mongoose.Schema;

ConfigSchema = new Schema({
  title: String
});

module.exports = mongoose.model("Config", ConfigSchema);
</code></pre>

<p>If I get data (using the <code>find</code> function) from this collection using this model, I get the whole object.<br>
Call: </p>

<pre><code>Config.find(function(err, configs) {
  if (err) res.send(err);
  res.json(configs);
});
</code></pre>

<p>Data returned : </p>

<p><a href="https://i.stack.imgur.com/TZLUh.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/TZLUh.png" alt="enter image description here"></a></p>

<p>What I thought was that Mongoose would validate the fetched data against the model to only return the data that fits the model so in this case, only the title for the element. I know I can use the <code>strict</code> attribute on Mongoose to enforce the model on save but what I am looking for is a way to only get the Modeled data.</p>

<p>Is there something I am missing here or am I just looking at the wrong tool for what I wish to accomplish. 
I found <a href="https://stackoverflow.com/q/11160955">this</a> which seems to do what I am looking for but I am not looking to overwrite the Mongoose schema simply to enforce it when I get data.</p>

