MongoDB Aggregation Sort Differently Depending on Projection<p>I have found an odd sorting behavior from MongoDB as I completed the MongDB Course M121. </p>

<p>You can test out the collection in this cluster with</p>

<pre><code>mongo mongodb://cluster0-shard-00-00-jxeqq.mongodb.net:27017,cluster0-shard-00-01-jxeqq.mongodb.net:27017,cluster0-shard-00-02-jxeqq.mongodb.net:27017/aggregations?replicaSet=Cluster0-shard-0" --authenticationDatabase admin --ssl -u m121 -p aggregations --norc
</code></pre>

<p>When I run the following the aggregate sort: </p>

<pre><code>var favorites = [
  "Sandra Bullock",
  "Tom Hanks",
  "Julia Roberts",
  "Kevin Spacey",
  "George Clooney"]

db.movies.aggregate([
  {
    $match: {
      "tomatoes.viewer.rating": { $gte: 3 },
      countries: "USA",
      cast: {
        $in: favorites
      }
    }
  },
  {
    $project: {
      _id: 0,
      title: 1,
      "tomatoes.viewer.rating": 1,
      num_favs: {
        $size: {
          $setIntersection: [
            "$cast",
            favorites
          ]
        }
      }
    }
  },
  {
    $sort: { num_favs: -1, "tomatoes.viewer.rating": -1, title: -1 }
  },
  {
    $limit: 10
  }
])
</code></pre>

<p>I'll get the following result:</p>

<pre><code>{ "title" : "Gravity", "tomatoes" : { "viewer" : { "rating" : 4 } }, "num_favs" : 2 }
{ "title" : "A Time to Kill", "tomatoes" : { "viewer" : { "rating" : 3.6 } }, "num_favs" : 2 }
{ "title" : "Extremely Loud &amp; Incredibly Close", "tomatoes" : { "viewer" : { "rating" : 3.5 } }, "num_favs" : 2 }
{ "title" : "Charlie Wilson's War", "tomatoes" : { "viewer" : { "rating" : 3.5 } }, "num_favs" : 2 }
{ "title" : "The Men Who Stare at Goats", "tomatoes" : { "viewer" : { "rating" : 3 } }, "num_favs" : 2 }
</code></pre>

<p>But if I change the projection slightly, from:</p>

<pre><code>    $project: {
      _id: 0,
      title: 1,
      "tomatoes.viewer.rating": 1,
</code></pre>

<p>To </p>

<pre><code>    $project: {
      _id: 0,
      title: 1,
      rating: "$tomatoes.viewer.rating",
</code></pre>

<p>or if I rid of the rating all together:</p>

<pre><code>    $project: {
      _id: 0,
      title: 1,
</code></pre>

<p>The resulting sort would also change:</p>

<pre><code>{ "title" : "The Men Who Stare at Goats", "rating" : 3, "num_favs" : 2 }
{ "title" : "Gravity", "rating" : 4, "num_favs" : 2 }
{ "title" : "Extremely Loud &amp; Incredibly Close", "rating" : 3.5, "num_favs" : 2 }
{ "title" : "Charlie Wilson's War", "rating" : 3.5, "num_favs" : 2 }
{ "title" : "A Time to Kill", "rating" : 3.6, "num_favs" : 2 }
</code></pre>

<p>Notice how the movie Gravity is no longer the top result.</p>

<p>Would anyone understand why sorting would change based on the projection? I was not expecting the projection to cause any changes to the sorting. </p>

