MEAN stack how to find _id from database to send a PUT request<p>I'm having a problem identifying a 'task' in mongoDB from my frontend angular.</p>

<p><a href="https://stackoverflow.com/questions/40844483/how-to-update-mongodb-with-angular-nodejs">This question</a> is the most similar to my question but here it just says <code>req.body.id</code> and doesn't really explain how they got that.</p>

<p><a href="https://stackoverflow.com/questions/52165805/mongodb-how-to-update-only-one-element-in-the-document">This question</a> involves what I am trying to do: update one document in a collection upon a click. What it does in the frontend isn't important. I just want to change the status text of the Task from <code>"Active"</code> to <code>"Completed"</code> onclick.</p>

<p>First I create a task and stick it in my database collection with this code:</p>

<pre><code>createTask(): void {
    const status = "Active";
    const taskTree: Task = {
      _id: this._id,
      author: this.username,
      createdBy: this.department,
      intendedFor: this.taskFormGroup.value.taskDepartment,
      taskName: this.taskFormGroup.value.taskName,
      taskDescription: this.taskFormGroup.value.taskDescription,
      expectedDuration: this.taskFormGroup.value.expectedDuration,
      status: status
    };   
    this.http.post("/api/tasks", taskTree).subscribe(res =&gt; {
      this.taskData = res;
    });
  }
</code></pre>

<p>When I make this post to the backend, _id is magically filled in!
I'm just not sure how I can pass the id to the put request in nodejs <code>router.put('/:id')</code> when I'm pushing it from the frontend like this:</p>

<pre><code>completeTask(): void {
    const status = "Completed";
    const taskTree: Task = {
      _id: this._id,
      author: this.username,
      createdBy: this.department,
      intendedFor: this.taskFormGroup.value.taskDepartment,
      taskName: this.taskFormGroup.value.taskName,
      taskDescription: this.taskFormGroup.value.taskDescription,
      expectedDuration: this.taskFormGroup.value.expectedDuration,
      status: status
    }; 
    console.log(taskTree);


    this.http.put("/api/tasks/" + taskTree._id, taskTree).subscribe(res =&gt; {
      this.taskData = res;
      console.log(res);

    });
  }
</code></pre>

<p>In the template I have a form that's filled in and the data is immediately outputted to a task 'card' on the same page.</p>

<p>When I send the put request from angular, I get a response in the backend just fine of the response I ask for in <code>task-routes.js</code>:</p>

<pre><code>router.put("/:id", (req, res, next) =&gt; {
    const taskData = req.body;
    console.log(taskData);

    const task = new Task({
        taskId: taskData._id,
        author: taskData.author,
        createdBy: taskData.createdBy,
        intendedFor: taskData.intendedFor,
        taskName: taskData.taskName,
        taskDescription: taskData.taskDescription,
        expectedDuration: taskData.expectedDuration,
        status: taskData.status
    })

    Task.updateOne(req.params.id, {
        $set: task.status
    },
    {
        new: true
    },
    function(err, updatedTask) {
        if (err) throw err;
        console.log(updatedTask);   
    }
    )

});
</code></pre>

<p>The general response I get for the updated info is:</p>

<pre><code>{
  author: 'there's a name here',
  createdBy: 'management',
  intendedFor: null,
  taskName: null,
  taskDescription: null,
  expectedDuration: null,
  status: 'Completed'
}
</code></pre>

<p>Now I know _id is created automatically in the database so here when I click create task &amp; it outputs to the 'card', in the console log of <code>task</code> after I <code>save()</code> it on the post request, <code>taskId: undefined</code> comes up. This is all fine and dandy but I have to send a unique identifier from the frontend Task interface so when I send the 'put' request, nodejs gets the same id as was 'post'ed.</p>

<p>I'm quite confused at this point.</p>

